gnA(){return"Deto est une application de calendrier de nomination gratuite pour toutes sortes d'\xe9v\xe9nements d\xe9mocratiques.\n\nDeto a \xe9t\xe9 con\xe7u et d\xe9velopp\xe9 pour vous et devrait \xeatre un outil utile pour que vous puissiez exprimer vos souhaits politiques et d\xe9mocratiques. Nous esp\xe9rons que nous pourrons contribuer une petite partie \xe0 cela avec notre application.\n\nLa r\xe9alisation et la r\xe9alisation de l'application DoTo sont un effort communautaire et il n'aurait jamais \xe9t\xe9 achev\xe9 sans l'aide d'une personne sp\xe9ciale. Par cons\xe9quent, nos remerciements particuliers vont \xe0 Roi Peker, qui a d\xe9velopp\xe9 l'int\xe9gralit\xe9 du backend technique pendant l'ensemble du d\xe9veloppement et l'a mis en \u0153uvre de mani\xe8re tr\xe8s comp\xe9tente, ainsi que toujours un coup de main tr\xe8s aidant \xe0 de nombreux autres points. Nous serions donc tr\xe8s heureux si vous souteniez cette personne, alors jetez un \u0153il \xe0 la bo\xeete de dialogue du d\xe9veloppeur, que vous pouvez trouver un peu plus loin. Cliquez une fois sur le champ pour l'agrandir, puis sur le bouton \xe0 l'int\xe9rieur.\n\nUn grand merci \xe0 tous les petits aides \xe0 des dot, dans un avenir proche ainsi que par le pass\xe9.\n\n- Ta m\xe8re\n\n- Ma m\xe8re\n\n- les autres m\xe8res\n\nSalutations sp\xe9ciales \xe0:\n\n- Roi Peker (Tech Mage)\n\nNous sommes toujours ouverts aux suggestions d'am\xe9lioration, si vous avez des questions ou quoi que ce soit d'autre, vous pouvez utiliser le formulaire de contact ou simplement rejoindre notre groupe t\xe9l\xe9gramme ou visiter le canal de t\xe9l\xe9grammes deto.\n\nNous vous souhaitons tout succ\xe8s avec vos \xe9v\xe9nements et nous esp\xe9rons que vous vous amuserez beaucoup avec votre application DoTo.\n\nMerci encore \xe0 Roi Peker, restez comme vous \xeates, une personne formidable ..."},
