gpY(){return"Detro \xe8 sviluppato e concepito per te, l'app dovrebbe essere uno strumento utile per te e offrirti una piattaforma per la collezione centrale e la pubblicazione dei tuoi eventi politicamente motivati, quindi ognuno di noi ora ha l'opportunit\xe0 di pianificare e pubblicare i nostri eventi, E quindi i tuoi eventi il \u200b\u200bpi\xf9 accessibili dal punto di vista centralmente e facilmente per essere presentati a un vasto pubblico per la visione.\n\nDetro si concentra principalmente su eventi politicamente motivati \u200b\u200bdemocraticamente, tuttavia, l'app offre anche l'opportunit\xe0 di creare e pubblicare eventi non politici.\n\nPuoi condividere i tuoi eventi o depositare le tue piattaforme social / live streaming o ricevere una notifica sui prossimi eventi e molto altro ...\n\nSperiamo di essere stati in grado di contribuire con una piccola parte allo sviluppo democratico con la nostra app e siamo molto felici se usi la nostra app e la consiglia se ti piace.\n\nIn caso di domande, richieste o suggerimenti per il miglioramento, \xe8 possibile utilizzare il modulo di contatto nella schermata Informazioni o semplicemente immettere il nostro gruppo Telegram T.Me./deto-app_group o visitare il canale t.me/deto_app_channel/. e iscriviti.\n\nTi auguriamo ogni successo nel creare e ospitare i tuoi eventi, speriamo che tu ti diverta molto con la tua app Detro.\n\nNOTA: selezionare l'opzione Lingua e Tema preferita, per continuare devi confermare la casella di controllo in basso\n\nIl tuo team di Deto"},
