gnA(){return"Detro \xe8 un'app di calendario degli appuntamenti gratuiti per tutti i tipi di eventi democratici.\n\nDetro \xe8 stato concepito e sviluppato per te e dovrebbe essere uno strumento utile per poter esprimere i tuoi desideri politici e democratici. Speriamo di poter contribuire con una piccola parte a questo con la nostra app.\n\nLa realizzazione e la realizzazione dell'app Deto \xe8 uno sforzo della comunit\xe0 e non sarebbe mai stato completato senza l'aiuto di una persona speciale. Pertanto, i nostri ringraziamenti speciali vanno a Roi Peker, che ha sviluppato l'intero backend tecnico durante l'intero sviluppo e lo ha implementato in modo molto competente, oltre a darci sempre una mano molto d'aiuto in molti altri punti. Saremo quindi molto felici se supportassi questa persona, quindi per favore dai un'occhiata allo sviluppatore grazie alla finestra di dialogo, che puoi trovare un po 'pi\xf9 in basso. Fare clic una volta sul campo per ingrandirlo e quindi sul pulsante all'interno.\n\nMille grazie a tutti i pi\xf9 piccoli aiutanti di Deto, nel prossimo futuro e in passato.\n\n- Tua madre\n\n- Mia madre\n\n- Le altre madri\n\nSaluti speciali a:\n\n- ROI Peker (Mage Tech)\n\nSiamo sempre aperti a suggerimenti per il miglioramento, se hai domande o qualsiasi altra cosa puoi utilizzare il modulo di contatto o semplicemente unirti al nostro gruppo Telegram o visitare il canale Deto Telegram.\n\nTi auguriamo ogni successo con i tuoi eventi e speriamo che tu ti diverta molto con la tua app Detro.\n\nGrazie ancora a Roi Peker, resta cos\xec come sei, una persona fantastica ...."},
